package com.teamproject.club_application.data;

public class TestData {
	private long id;
	private int num;
	
	public TestData() {
		// TODO Auto-generated constructor stub
	}
	
	public TestData(long id, int num) {
		super();
		this.id = id;
		this.num = num;
	}
	public long getId() {
		return id;
	}
	public void setId(long id) {
		this.id = id;
	}
	public int getNum() {
		return num;
	}
	public void setNum(int num) {
		this.num = num;
	}
	
	
}
